INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Mano del Rey', 'El Mano del Rey es el principal asesor del rey y actúa como su mano derecha', 1);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Guardaespaldas Real', 'Los Guardaespaldas Reales son un cuerpo de élite que protege al monarca y a su familia', 2);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Lord Comandante de la Guardia Nocturna', 'El Lord Comandante de la Guardia Nocturna es el líder de la orden encargada de defender el Muro', 3);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Mano de la Reina', 'La Mano de la Reina es el principal asesor de la reina y actúa como su mano derecha', 4);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Maestre', 'Los Maestres son expertos en medicina y asesoran a los nobles en asuntos de salud y otros temas', 5);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Septón', 'Los Septones son sacerdotes del Culto de los Siete y realizan ceremonias y ritos religiosos', 6);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Gran Maestre de la Orden de los Maestres', 'El Gran Maestre de la Orden de los Maestres es el líder de la orden y tiene la última palabra en temas relacionados con la educación y la investigación', 7);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Caballero de la Guardia Real', 'Los Caballeros de la Guardia Real son la guardia personal del rey y se les considera los guerreros más hábiles y valientes de los Siete Reinos', 8);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Señor de Aguasdulces', 'El Señor de Aguasdulces es el gobernante de la región de Aguasdulces y es un importante aliado de los Stark', 9);
INSERT INTO titulo (nombre, descripcion, codigo_personaje) VALUES ('Señor de Invernalia', 'El Señor de Invernalia es el gobernante de la región del Norte y es la casa gobernante de los Stark', 10);

