INSERT INTO arma (nombre, alcance, daño, descripcion) 
VALUES ('Agujas', 2.5, 20, 'Agujas es una espada valyria forjada en la Edad de los Héroes y que ha sido transmitida a través de la Casa Stark desde la época de Brandon el Constructor. Es una espada de tamaño pequeño y manejable, perfecta para Arya Stark, la hija menor de Lord Eddard Stark, y su estilo de lucha ágil y rápido.');
INSERT INTO arma (nombre, alcance, daño, descripcion) 
VALUES ('Garra', 3.2, 25, 'Garra es una espada bastarda de acero valyrio perteneciente a la Casa Mormont de la Isla del Oso. Es una espada ligera y bien equilibrada, con una hoja ancha y ligeramente curvada que la hace ideal para los golpes de corte. Fue llevada a la Batalla de los Bastardos por Jorah Mormont y ayudó a asegurar la victoria para su casa.');
INSERT INTO arma (nombre, alcance, daño, descripcion) 
VALUES ('Aguardiente', 1.5, 15, 'Aguardiente es un hacha de doble filo de la Casa Clegane. Es una de las armas más grandes y pesadas en uso en los Siete Reinos, y se dice que sólo Sandor Clegane es capaz de manejarla con una sola mano. Fue utilizada por Sandor durante la Batalla de Blackwater y ha demostrado ser una herramienta formidable en el campo de batalla.');
INSERT INTO arma (nombre, alcance, daño, descripcion) 
VALUES ('Lluvia de Verano', 2.7, 30, 'Lluvia de Verano es una espada larga de acero valyrio de la Casa Tarly. Es una espada ligera y bien equilibrada, con una hoja recta y afilada que la hace perfecta para los golpes de estocada. Fue llevada por su dueño, Randyll Tarly, durante la Batalla de Aguasnegras y se dice que desempeñó un papel importante en la victoria de los Lannister.');
INSERT INTO arma (nombre, alcance, daño, descripcion) 
