/*CONSULTAS*/
SELECT casa.nombre AS Casa, COUNT(personaje.codigo) AS "Nº personajes", 
       SUM(dragon.codigo) AS "Nº dragones"
FROM casa 
LEFT JOIN personaje ON casa.codigo = personaje.codigo_casa
LEFT JOIN dragon ON casa.codigo = dragon.codigo_casa
GROUP BY casa.nombre 
ORDER BY COUNT(personaje.codigo) DESC, casa.nombre ASC;



SELECT p.nombre, p.apellido, DATEDIFF(p.fechaMuerte, p.fechaNacimiento) AS edad_al_morir, COUNT(m.codigo) AS apariciones_totales
FROM personaje p
JOIN aparece a ON p.codigo = a.codigo_personaje
JOIN minuto m ON a.num_capitulo = m.num_capitulo AND a.codigo_temporada = m.codigo_temporada AND a.codigo_personaje = m.codigo_personaje
WHERE p.fechaMuerte IS NOT NULL
GROUP BY p.codigo
ORDER BY apariciones_totales DESC;


SELECT UPPER(p.nombre) AS "Personaje", COUNT(pta.codigo_arma) AS "Nº Armas"
FROM personaje p
JOIN personajetienearma pta ON p.codigo = pta.codigo_personaje
WHERE (YEAR(p.fechaMuerte) - YEAR(p.fechaNacimiento) > 30) OR (p.fechaMuerte IS NULL AND YEAR(NOW()) - YEAR(p.fechaNacimiento) > 30)
GROUP BY p.codigo
HAVING COUNT(pta.codigo_arma) > 1;


SELECT c.nombre AS "CCAA", COUNT(DISTINCT l.codigo) AS "Nº Lugares emblemáticos", COUNT(DISTINCT s.codigo) AS "Nº Sucesos"
FROM comunidad c
LEFT JOIN provincia p ON c.codigo = p.codigo_comunidad
LEFT JOIN municipio m ON p.codigo = m.codigo_provincia
LEFT JOIN lugaresemblematicos l ON m.codigo = l.codigo_municipio
LEFT JOIN sucesos s ON l.codigo = s.codigo_lugaresemblematicos
GROUP BY c.nombre
ORDER BY c.nombre ASC;



SELECT c.nombre AS "Casa sin sucesos", AVG(d.tamaño) AS "Media tamaño dragones", MIN(d.longitud) AS "Longitud mínima de sus alas"
FROM casa c
LEFT JOIN tiene t ON c.codigo = t.codigo_casa
LEFT JOIN dragon d ON t.codigo_dragon = d.codigo
WHERE c.territorio NOT IN (
    SELECT le.codigo_municipio
    FROM sucesos s
    JOIN lugaresemblematicos le ON s.codigo_lugaresemblematicos = le.codigo
)
GROUP BY c.codigo;










/*Función 1*/
DELIMITER $$
DROP FUNCTION IF EXISTS fn_numPersonajesArma;
CREATE FUNCTION fn_numPersonajesArma(codArma INT)
RETURNS INT
READS SQL DATA
BEGIN
	DECLARE num_personajes INT DEFAULT -1;
	IF EXISTS (SELECT * FROM personajetienearma WHERE personajetienearma.codigo_arma = codArma) THEN
		SELECT COUNT(personajetienearma.codigo_personaje) INTO num_personajes FROM personajetienearma 
		WHERE personajetienearma.codigo_arma = codArma;
	END IF;
    RETURN num_personajes;
END $$
DELIMITER ;

SELECT fn_numPersonajesArma(4);
SELECT fn_numPersonajesarma(14);





/*Función 2*/
DELIMITER $$
DROP FUNCTION IF EXISTS fn_insertaSuceso $$
CREATE FUNCTION fn_insertaSuceso (codLugarEmblematico INT, codPersonaje INT, nombreSuceso VARCHAR(50)) 
RETURNS INT
READS SQL DATA
BEGIN
     /*La condición del enunciado "Código del suceso: el máximo existente más 1." ya la cumple 
     nuestra tabla al ser AUTO_INCREMENT*/
     IF NOT EXISTS (SELECT * FROM lugaresemblematicos WHERE codigo = codLugarEmblematico) THEN
        RETURN -3;
     ELSEIF NOT EXISTS (SELECT * FROM personaje WHERE codigo = codPersonaje) THEN
        RETURN -2;
     ELSEIF CHAR_LENGTH(nombreSuceso) < 3 THEN
        RETURN -1;
     ELSE
        INSERT INTO sucesos (nombre, codigo_lugaresemblematicos, codigo_personaje) VALUES (nombreSuceso, codLugarEmblematico, codPersonaje);
        RETURN 0;
     END IF;
END $$
DELIMITER ;

SELECT fn_insertaSuceso (23748, 1, 'Muerte de dragón');
SELECT fn_insertaSuceso (1, 23748, 'Muerte de dragón');
SELECT fn_insertaSuceso (1, 1, 'M');
SELECT * FROM sucesos JOIN lugaresemblematicos ON lugaresemblematicos.codigo = sucesos.codigo_lugaresemblematicos
JOIN personaje ON personaje.codigo = sucesos.codigo_personaje;
SELECT fn_insertaSuceso (1, 1, 'Muerte de dragón');
SELECT * FROM sucesos JOIN lugaresemblematicos ON lugaresemblematicos.codigo = sucesos.codigo_lugaresemblematicos
JOIN personaje ON personaje.codigo = sucesos.codigo_personaje;


/*procedimiento*/
DROP PROCEDURE IF EXISTS sp_armasPersonajes;
DELIMITER $$
CREATE PROCEDURE sp_armasPersonajes()
BEGIN
	DECLARE fin INT DEFAULT FALSE;
	DECLARE nomArma VARCHAR(50);
	DECLARE numPersonajes INT;
	DECLARE numPersonaje INT;
	DECLARE nomPersonaje VARCHAR(50);
	DECLARE cur1 CURSOR FOR SELECT nombre, fn_numPersonajesArma(codigo) FROM arma;
	DECLARE cur2 CURSOR FOR SELECT p.nombre
								FROM personaje p
								JOIN personajetienearma pa ON p.codigo = pa.codigo_personaje
								JOIN arma a ON a.codigo = pa.codigo_arma
								WHERE a.nombre = @idarma;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET fin = TRUE;
	
    OPEN cur1;
    
    FETCH cur1 INTO nomArma, numPersonajes;
    
    WHILE (NOT fin) DO
			SELECT CONCAT('Arma: ', nomArma, ' - Personajes que lo usan: ', numPersonajes)  AS 'Número de personajes que usan el arma';
            
            OPEN cur2;
            
            FETCH cur2 INTO nomPersonaje;
            
			WHILE (NOT fin) DO
				IF numPersonajes = 0 THEN
					SELECT 'No utilizada';
				ELSE
					SET fin = FALSE;
					SET @idArma = LAST_INSERT_ID();
					SELECT CONCAT('Personaje Nº: ', numPersonaje, ' Nombre: ', nomPersonaje);
				END IF;
                FETCH cur2 INTO nomPersonaje;
            END WHILE;
            CLOSE cur2;
            FETCH cur1 INTO nomArma, numPersonajes;
	END WHILE;
    CLOSE cur1;
END $$
DELIMITER ;

CALL sp_armasPersonajes();



